import React, {useState} from 'react';

const style = {
  border: "1px solid black",
  padding: '1px',
  margin: '1px'
};

function valueControl(props) {
  return (
    <div style='border: 1px solid black;'>
      <p>{props.name}</p>
      <p>{props.value} {props.unit}</p>
    </div>
  );
}

export default function ChannelControl(props) {
  return (
    <div style={style}>
      Channel {props.channel}
      <button>Active</button> <br/>
      Offset<button>+</button><button>-</button> <br/>
      Scale..<button>+</button><button>-</button>
    </div>
  )
}
